1	40	vi	Hai Tổng	Cho một mảng các số nguyên nums và một số nguyên target, trả về các chỉ số của hai số sao cho tổng của chúng bằng target. Bạn có thể cho rằng mỗi đầu vào sẽ có đúng một giải pháp và bạn không được sử dụng cùng một phần tử hai lần. Bạn có thể trả về câu trả lời theo bất kỳ thứ tự nào. **Ví dụ 1:** Đầu vào: nums = [2,7,11,15], target = 9 Đầu ra: [0,1] Giải thích: Vì nums[0] + nums[1] == 9, chúng ta trả về [0, 1]. **Ví dụ 2:** Đầu vào: nums = [3,2,4], target = 6 Đầu ra: [1,2] **Ví dụ 3:** Đầu vào: nums = [3,3], target = 6 Đầu ra: [0,1]	2 &lt;= nums.length &lt;= 10^4 -10^9 &lt;= nums[i] &lt;= 10^9 -10^9 &lt;= target &lt;= 10^9 Chỉ có một câu trả lời hợp lệ.	2025-06-18 13:11:34.571649	\N
2	41	vi	Chuỗi con dài nhất không có ký tự lặp lại	Cho một chuỗi s, tìm độ dài của chuỗi con dài nhất mà không có các ký tự lặp lại. **Ví dụ 1:** Đầu vào: s = &quot;abcabcbb&quot; Đầu ra: 3 Giải thích: Câu trả lời là &quot;abc&quot;, với độ dài là 3. **Ví dụ 2:** Đầu vào: s = &quot;bbbbb&quot; Đầu ra: 1 Giải thích: Câu trả lời là &quot;b&quot;, với độ dài là 1. **Ví dụ 3:** Đầu vào: s = &quot;pwwkew&quot; Đầu ra: 3 Giải thích: Câu trả lời là &quot;wke&quot;, với độ dài là 3. Lưu ý rằng câu trả lời phải là một chuỗi con, &quot;pwke&quot; là một dãy con chứ không phải là một chuỗi con.	0 &lt;= s.length &lt;= 5 * 10^4 s bao gồm các chữ cái tiếng Anh, chữ số, ký hiệu và khoảng trắng.	2025-06-18 13:11:35.227601	\N
